import React from 'react';
import './'

const CouponResult = ({ products }) => {
  return (
    <div className="coupon-list">
      {products.map((product) => (
        <div key={product.id} className="coupon-card">
          <img src={product.imageUrl} alt={product.couponTitle} />
          <h3>{product.couponTitle}</h3>
          <p>Coupon Code: {product.couponCode}</p>
          <p>Percentage: {product.percentage}% off</p>
          <p>Website: {product.website}</p>
          <p>Category: {product.category}</p>
          <p>Created At: {product.createdAt}</p>
          <p>Expires At: {product.expiredAt}</p>
          <p>Status: {product.status}</p>
          <a href={product.affiliateLink} target="_blank" rel="noopener noreferrer">
            Get Deal
          </a>
        </div>
      ))}
    </div>
  );
};

export default CouponResult;
